import * as React from "react";
import Box from "@mui/material/Box";
import { Grid, IconButton, Link, Typography, Stack } from "@mui/material";
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
import InstagramIcon from "@mui/icons-material/Instagram";
import YouTubeIcon from "@mui/icons-material/YouTube";
import LinkedInIcon from "@mui/icons-material/LinkedIn";

function Footer() {
  return (
    <>
      <Box component="main" sx={{ p: 3, backgroundColor: "#d6d6d6" }}>
        <Typography textAlign="center" color="inherit">
          <Link
            aria-label="facebook"
            href="javascript:;"
            target="_blank"
            sx={{ color: "inherit", textDecoration: "none" }}
          >
            V COMPUTER CLINIC
          </Link>
        </Typography>
        <Grid container spacing={5} textAlign="center">
          <Grid item xs={12} md={12}>
            <Stack spacing={2} direction="row" justifyContent="center" mb={1}>
              <IconButton
                aria-label="facebook"
                sx={{
                  "& :hover, & .Mui-focusVisible": {
                    color: "#3b5998",
                  },
                }}
              >
                <Link
                  aria-label="facebook"
                  href="https://www.facebook.com/pages/5nanceCom/409567769207047"
                  target="_blank"
                  sx={{ color: "inherit", textDecoration: "none" }}
                >
                  <FacebookIcon fontSize="medium" />
                </Link>
              </IconButton>
              <IconButton
                aria-label="twitter"
                sx={{
                  "& :hover, & .Mui-focusVisible": {
                    color: "#00acee",
                  },
                }}
              >
                <Link
                  href="https://twitter.com/5nancetweets"
                  target="_blank"
                  aria-label="twitter"
                  sx={{ color: "inherit", textDecoration: "none" }}
                >
                  <TwitterIcon fontSize="medium" />
                </Link>
              </IconButton>
              <IconButton
                aria-label="instagram"
                sx={{
                  "& :hover, & .Mui-focusVisible": {
                    color: "#fb3958",
                  },
                }}
              >
                <Link
                  href="https://www.instagram.com/5nance"
                  target="_blank"
                  aria-label="instagram"
                  sx={{ color: "inherit", textDecoration: "none" }}
                >
                  <InstagramIcon fontSize="medium" />
                </Link>
              </IconButton>
              <IconButton
                aria-label="youtube"
                sx={{
                  "& :hover, & .Mui-focusVisible": {
                    color: "#FF0000",
                  },
                }}
              >
                <Link
                  aria-label="youtube"
                  href="https://www.youtube.com/channel/UCDPxjkHa4hYcu6lvItwIPxA"
                  target="_blank"
                  sx={{ color: "inherit", textDecoration: "none" }}
                >
                  <YouTubeIcon fontSize="medium" />
                </Link>
              </IconButton>
              <IconButton
                aria-label="linkedin"
                sx={{
                  "& :hover,:focus": {
                    color: "#0e76a8",
                  },
                  borderRadius: "2px",
                }}
              >
                <Link
                  aria-label="linkedin"
                  href="https://www.linkedin.com/company/10838832/"
                  target="_blank"
                  sx={{ color: "inherit", textDecoration: "none" }}
                >
                  <LinkedInIcon fontSize="medium" />
                </Link>
              </IconButton>
            </Stack>
          </Grid>
        </Grid>
      </Box>
    </>
  );
}
export default Footer;
